const Deneme = () => (
  <div id="table-container">
    <iframe id="table" src="https://scraperproject.herokuapp.com/" />
    <style jsx>{`
      #table-container {
        display: inline-block;
        width: 100%;
        height: 100%;
      }
      #table {
        display: inline-block;

        width: 100%;
        height: 100%;
      }
    `}</style>
  </div>
);

export default Deneme;
